package com.hariom.entity;

public class IdEvidence {
	String id;
	String evidence;
	public IdEvidence() {
		super();
		// TODO Auto-generated constructor stub
	}
	public IdEvidence(String id, String evidence) {
		super();
		this.id = id;
		this.evidence = evidence;
	}
	public String getId() {
		return id;
	}
	public void setId(String id) {
		this.id = id;
	}
	public String getEvidence() {
		return evidence;
	}
	public void setEvidence(String evidence) {
		this.evidence = evidence;
	}
	
	
}
